@-moz-document domain("dropbox.com") {
	/*
	 * LS 2012-04-19 14:32:01
	 * !important is required for the Firefox extension - everything works just great without it for Chrome.
	 */
	.list_view .browse-file,
	.list_view .browse-new-folder,
	#gallery-view-folders li,
	.gallery-list-view .browse-file
	{
		line-height:16px!important;
	}
	
	.list_view .browse-file .filename-col,
	.list_view .browse-new-folder .filename-col
	{
		height: 16px;
	}

	li.browse-file.deleted {
		background-color:#f2f2f2!important;
	}

	.mouse-active .browse-file.deleted:hover {
		background-color:#f4f4f4!important;
	}

	/*
	 * LS 2012-04-19 14:24:37
	 * Align the link icon on the right properly in file lists.
	 */
	.list_view .browse-file .shmodel-file,
	.list_view .browse-new-folder .shmodel-file {
		top:7px!important;
	}

	#links-view ol#links-list li.link .caption,
	#links-view ol#links-list li.link .created-col,
	#links-view ol#links-list li.link .options-col {
		margin-top:0!important;
	}

	#links-view ol#links-list li.link {
		height:auto!important;
	}

	.list_view .browse-file img.sprite,
	.list_view .browse-new-folder img.sprite,
	#sf-view .sf-folder img.sprite,
	/*
	 * LS 2012-06-08 10:12:45
	 * Fixes icons being invisible in "Get link" public shared views…
	 * eg. https://www.dropbox.com/sh/yxf8k4pm2yt66c5/InasuH6RAr?lst
	 */
	.gallery-view-section .sprite,
	.thumb-link .sprite,
	#links-list .sprite/*,
	.sprite.sprite_web.s_web_s_link*/ {
		background-position:0 0!important;
		width:16px!important;
		height:16px!important;
		background-size:100%!important;
		/*-webkit-filter:grayscale(100%)!important;
		-webkit-filter:grayscale(1)!important;*/
	}


	/*
	 * LS 2012-04-19 14:23:15
	 * Use the 16px icons and tighten up the Sharing section
	 * https://www.dropbox.com/share
	 */
	#sf-view ol#sf-list li.sf-folder .filename-col img {
		margin:2px 11px 16px 10px!important;
	}
	#sf-view ol#sf-list li.sf-folder {
		padding:4px 0!important;
	}

	/*
	 * LS 2012-04-19 14:22:34
	 * Tighten up the events section
	 * https://www.dropbox.com/events
	 */
	#event-table td,
	#old-event-table td    /* 2014-01-30 15:05 21 - update for 2014 styling. */
	{
		padding:4px 0!important;
	}

	/*
	 * LS 2012-04-19 14:29:47
	 * I don't really like the border…
	 * 
	 * LS 2012-06-08 10:15:02
	 * Reduce the specificity to catch more examples. Now it works on "Get link" public shared views…
	 * eg. https://www.dropbox.com/sh/yxf8k4pm2yt66c5/InasuH6RAr?lst
	 * Also, changed border color to transparent instead of #fff for more flexibility
	 * and removed the box shadow as it isn't doing much for me.
	 */
	img.thumbnail,
	.list_view .browse-file .thumbnail-border,
	.list_view .browse-new-folder .thumbnail-border
	{
		border-color:transparent!important;
		   -moz-box-shadow:none!important;
		-webkit-box-shadow:none!important;
		        box-shadow:none!important;
		width:14px;
		height:14px;
	}

